=1,},[62]={['Yaw']=2.007129,['SizeX']=46.456456,['Y']=10722,['Color']=102439,['Id']=1500,['Roll']=0,['Alpha']=1,['SizeY']=50,['MetaData']={['message']='A quelques lieux du village, là ou même la vieille sorcière n\\'ose s\\'aventurer vis l\\'Arachnia. \\n\\nOn raconte que sa taille est le double de la plus grosse araignée que vous ayez rencontrée et que si vous croisez un jour ses ignobles yeux verts, s\\'en est fini de vous !\\n\\nMais l\\'Arachnia se sentait bien seule au fond de son bois, alors elle décida de se multiplier. Ses enfants lui ressemblaient comme deux gouttes d\\'eau; les mêmes yeux verts affreux et la chitine verdâtre également.\\n\\nConsciente de l\\'armée qu\\'elle pourrait lever, elle décida d\\'ajouter de nouveaux membres à sa famille mais cette fois ci, elle leur donna une teinte rougeâtre afin de créer une hiérarchie dans ses enfants-soldats. \\n\\nPas encore tout à fait satisfaite, d\\'autres bébés naquirent, ceux-ci légèrement bleutés, mais très vite, elle se rendit compte que ces derniers n\\'étaient pas assez forts, alors malgré tout son amour pour eux, elle décida de les supprimer. \\n\\nCes naissances l\\'ayant épuisé, elle prit un peu de repos avant de marcher sur le village...\\n\\nPrononcez la bonne et entrez',['title']='La légende de l\\'Arachnia',},['X']=103329.445875,['Groups']=0,['Z']=89052.606966,['Pitch']=5.235988,['EffectType']=8502,['SizeZ']=50,['Contrast']=1,},[63]={['Yaw']=0.436332,['SizeX']=46.456456,['Y']=10723,['Color']=102439,['Id']=1501,['Roll']=0,['Alpha']=1,['SizeY']=50,['MetaData']={['message']='Il était une fois, dans le bois sombre et hanté bordant le village, une vieille sorcière qui chérissait un magnifique arbre bleu. \\n\\nCette sorcière terrorisait tous les villageois ! Ces derniers empruntaient toujours la route du Nord Est car elle était plus sûr. Toutes ces pauvres âmes avaient un jour croisé la vieille sorcière, souvent à leur dépends. On raconte qu\\'avant de mourir, elle leur aurait hurlé :\\n \\n\"Vous n\\'aurez pas mon arbre bleu !\" \\n\\nMais personne n\\'avait jamais vu d\\'arbre bleu dans la région. D\\'aucun pensaient même que les arbres bleus n\\'existaient pas. \\n\\n\"Les arbres ne sont pas bleus voyons ! Ils verdissent au printemps et rougissent durant l\\'automne, mais pardi jamais, au grand jamais, nous n\\'en avons vu de bleu, cette sorcière n\\'est pas seulement dangereuse, elle est folle !\".\\n\\nDepuis, plein d\\'espoir de ramener la paix au village, les habitants partent régulièrement à la chasse à la sorcière, pendant que celle-ci se délecte de la dépouille des trainards ainsi que de leurs trésors, mais elle reste aussi introuvable que son bel arbre bleu !\\n\\n\\nPrononcez la bonne et entrez.\\n',['title']='La sorcière et son arbre chéri',},['X']=103654,['Groups']=0,['Z']=88027,['Pitch']=5.305801,['EffectType']=8502,['SizeZ']=50,['Contrast']=1,},[64]={['Yaw']=5.215044,['SizeX']=46.456456,['Y']=10719,['Color']=102439,['Id']=1502,['Roll']=0,['Alpha']=1,['SizeY']=50,['MetaData']={['message']='Trois jeunes hommes du village se connaissaient depuis toujours. Ils avaient fait les 400 coups ensemble, étaient inséparables. Leur plus grand rêve : habiter cette magnifique demeure en haut de la colline. Un jour, l\\'ainé disparu sans laisser de traces pendant des mois. Les deux autres cherchèrent sans relâche. \\n\"Je vais au Nord-Est\" \\n\"Je prends le Nord-Ouest, le Sud est bien trop dangereux\"\\nCe fut vain. Un matin, l\\'ainé revint soudainement. Quelle ne fut pas leur joie de tous se retrouver ! L\\'euphorie passée, les cadets demandèrent tristement\\n\"Mais ou es-tu allé ? Tu ne nous aimes plus ?\"\\n\"Je vous aime mes frères, et je vous aimerais toujours. Nous ne sommes pas des frères de sang, mais nous allons le devenir.\"\\nAlors l\\'ainé tendit un contenant de liquide rouge sombre.\\n\"Buvez mes frères, nous manquions d\\'un cadre pour une nouvelle vie, j\\'en offre un pour chacun de nous\"\\nTous trois burent de ce liquide rouge et épais. Le gout ferreux écoeura les plus jeunes, le teint verdâtre, ils finirent même par perdre connaissance. A leurs réveils, ils se trouvaient dans la demeure de leurs rêves.\\n\"C\\'est ici que nous vivrons notre amour et marquerons l\\'histoire\" s\\'exclama l\\'ainé.\\nLes cadets sentirent une soif incontrôlée leur bruler la gorge, le plus âgé leur proposa une promenade au bord de la rivière afin de penser à autre chose. En se regardant dans les flots bleutés, les jeunes furent effrayés par leur teint pâle et les yeux rouges. L\\'ainé les rassura : \\n\"N\\'ayez crainte mes frères, désormais nous vivrons éternellement\".\\n\"Nous ne pouvons plus mourir ?\"\\n\"Si, mais alors le ciel pleurera des larmes de sang et nos âmes iront ou vous m\\'avez cherché\"\\n\\nPrononcez la bonne et entrez',['title']='3 frères pas comme les autres',},['X']=104682,['Groups']=0,['Z']=88356,['Pitch']=5.235988,['EffectType']=8502,['SizeZ']=50,['Contrast']=1,},[65]={['Yaw']=4.712389,['SizeX']=6000,['Id']=1515,['Z']=160207,['Color']=494947,['Alpha']=1,['SizeY']=6000,['Roll']=0,['Groups']=0,['X']=155625,['Y']=27604,['Pitch']=0,['EffectType']=655,['Contrast']=1,['SizeZ']=6000,},[66]={['Yaw']=4.712389,['SizeX']=2280,['Id']=1516,['Z']=160333,['Color']=494947,['Alpha']=1,['SizeY']=2280,['Roll']=0,['Groups']=0,['X']=155681,['Y']=19774,['Pitch']=0,['EffectType']=655,['Contrast']=1,['SizeZ']=2280,},[67]={['Yaw']=0,['SizeX']=6260,['Id']=1519,['Z']=72048,['Color']=494947,['Alpha']=1,['SizeY']=6260,['Roll']=0,['Groups']=0,['X']=120547,['Y']=10352,['Pitch']=0,['EffectType']=650,['Contrast']=1,['SizeZ']=6260,},[68]={['Yaw']=0,['SizeX']=1000,['Id']=1522,['Z']=72124,['Color']=494947,['Alpha']=1,['SizeY']=1000,['Roll']=0,['Groups']=0,['X']=120392,['Y']=10346,['Pitch']=0,['EffectType']=655,['Contrast']=1,['SizeZ']=1000,},[69]={['Yaw']=4.712389,['SizeX']=1000,['Id']=1523,['Z']=75050,['Color']=494947,['Alpha']=1,['SizeY']=1000,['Roll']=0,['Groups']=0,['X']=124100,['Y']=10742,['Pitch']=0,['EffectType']=650,['Contra