R["fx__na__@malderyn__43"]="{['Version']=1762,['TS']=1633258720,['Effects']={[1]={['SizeX']=100,['Y']=0,['Groups']=0,['EffectType']=614,['Id']=1349,['Contrast']=1,['Yaw']=0,['SizeZ']=100,['SizeY']=100,['Color']=494949,['X']=0,['Z']=0,['Roll']=0,['Pitch']=0,['Alpha']=1,},[2]={['SizeX']=150000,['Y']=1,['Groups']=0,['EffectType']=439,['Id']=1350,['Contrast']=3.900000,['Yaw']=0,['SizeZ']=150000,['SizeY']=150000,['Color']=999999,['X']=46086,['Z']=45934,['Roll']=0,['Pitch']=0,['Alpha']=0.060000,},[3]={['SizeX']=46.456456,['Groups']=0,['Y']=12500,['MetaData']={['title']='The Brass Cathedral',['message']='By Sedrys Arathas, Antiquarian\\n\\nFew people know of the Clockwork City, and even fewer are aware of the strange little realm called the Cathedral of Brass. Seemingly located just north of Vivec City, most scholars agree that the town is in fact a sort of pocket realm created to mimic the appearance of Vvardenfell.\\n\\nIt is not known who is responsible for creating the town, but its existence has been dated to at least 2E 56, when a slave of House Dres reported stumbling upon an city \"with spires of bronze and trees of silver\". He was whipped when he failed to lead his masters to these purported riches. Since then, tales are occasionally told of the Cathedral by lost travelers claiming to have found a door in the wilderness, leading to the majestic city.\\n\\nThe architecture of the town appears similar to that of the Clockwork City, at least according to the handful of sources that we have describing the two. Some elements of traditional Great House architecture can be seen beneath the brass machinations, perhaps suggesting that this was an early prototype long forgotten by Sotha Sil. Its namesake cathedral is said to dominate the town, with a delicately wrought facade of gold and bronze unlike any temple in all of Tamriel.\\n\\nIn a previous treatise, I theorised that a mage well-versed in planar magicks might be able to discern the entrance to the hidden realm - getting inside, however, might be another challenge altogether. If the entrance is indeed a door as most accounts suggest, perhaps the rumoured Skeleton Key of Nocturnal might serve to open the way. Unfortunately, until I am able to get ahold of Divayth Fyr or book an appointment with a Daedric Prince, the mysteries of the Cathedral will have to wait.',},['EffectType']=8503,['Id']=1354,['Contrast']=1,['Yaw']=3.738495,['SizeZ']=70,['SizeY']=70,['Color']=102439,['X']=47327.321317,['Z']=51490.779183,['Roll']=0,['Pitch']=5.323254,['Alpha']=0,},},}"
