sage']='1. This started as part of a wayshrine contest.\\nThe theme, \"it has to have a flame, a pedestal, and\\na stair leading up to it.\" So, my theme...\\n\"What if Sotha Sil built a Universal Wayshrine so\\nmighty, it required the power of all of Nirn to run it?\"',},['Y']=50602,['Yaw']=5.222025,['Color']=99,['Pitch']=0,['Id']=1555,['SizeY']=400,['Z']=104069.830295,['Contrast']=1,['SizeZ']=400,['Groups']=0,['Roll']=0,['X']=56778.595786,['Alpha']=1,['SizeX']=980,},[10]={['EffectType']=4407,['MetaData']={['message']='2. So, I built the wayshrine in the basement of the house. Having done\\nthat, I decided to go overboard (because reasons), and converted the\\nwhole house to support that theme. This is the result: The culmination\\nof Sotha Sil\\'s ambitions to build a wayshrine to pierce Aetheriuis. Alas, that\\ndoesn\\'t mean they work the way you want.',},['Y']=50627,['Yaw']=4.405211,['Color']=99,['Pitch']=0,['Id']=1556,['SizeY']=322,['Z']=105153.320782,['Contrast']=1,['SizeZ']=322,['Groups']=0,['Roll']=0,['X']=56890.288806,['Alpha']=1,['SizeX']=1140,},[11]={['EffectType']=4407,['MetaData']={['message']='3. The exterior of the house holds his power plants, flooding his clockwork\\nconstruct with pure energy. They are combined in the center, then\\nrouted inside to the left of the doorway. You can follow that conduit down\\nto the lower levels, where equipment deactivated, and the door to the \\nWayshrine secured by an energy field, until you throw a switch to complete\\nthe circuit. To a Clockwork Laser.\\nYou may also explore the Viewing Room on the main floor, which overlooks\\nthe machinery floor that powers the Wayshrine below.\\n\\nEnjoy a sweetroll while you are there. The Dwarven chefbot is quite skilled\\nat baking.',},['Y']=50587,['Yaw']=2.872812,['Color']=99,['Pitch']=0,['Id']=1557,['SizeY']=362,['Z']=106117.689900,['Contrast']=1,['SizeZ']=362,['Groups']=0,['Roll']=0,['X']=55100.971242,['Alpha']=1,['SizeX']=1060,},[12]={['EffectType']=4407,['MetaData']={['message']='4. Pass through the door, and the shrine will be inert (powered off), and the\\nway forward blocked by a security field. Throw the switch next to the gate,\\nand it will deactivate the security field and power up the Wayshrine, with\\neverything coming alive.\\n\\nOne last thing: The wayshrine project was a success. (If you use EHT.)\\n(You may also notice some off-theme furniture behind these walls... Don\\'t\\nmind the mess, sometimes it helps to do a little decorating jazz to get the\\njuices flowing.)\\n\\nI hope you enjoy this build. Please let me know if you do!\\n\\n-T.',},['Y']=50589,['Yaw']=2.066470,['Color']=99,['Pitch']=0,['Id']=1558,['SizeY']=422,['Z']=105469.308936,['Contrast']=1,['SizeZ']=422,['Groups']=0,['Roll']=0,['X']=54265.949946,['Alpha']=1,['SizeX']=1100,},[13]={['EffectType']=1010,['MetaData']={['when furniture']='4625903927840869831',['is']='On',['then group']='Staging Area Lights',['will be']='On',['then group furniture']='4612199632093272950,4612199632092892744,4612199632093450845,4612199632093451730,4612199632093451731,4612199632093451729,4612199632092394534,4612199632092187460,4612199632093454084,4612199632093454574,4612199632093454569,4612199632093454575,4612199632093274539,4612199632093454083,4612199632093454082,4612199632092201436,4612199632093454567,4612199632093454586,4612199632093454584,4612199632093450259,4612199632093455713',},['Y']=49157,['Yaw']=2.059489,['Color']=999998,['Pitch']=0,['Id']=1559,['SizeY']=1,['Z']=94325.420734,['Contrast']=1,['SizeZ']=1,['Groups']=0,['Roll']=0,['X']=50741.557861,['Alpha']=1,['SizeX']=1,},[14]={['EffectType']=1010,['MetaData']={['when furniture']='4625903927840869831',['is']='Off',['then group']='Staging Area Lights',['will be']='Off',['then group furniture']='4612199632093272950,4612199632092892744,4612199632093450845,4612199632093451730,4612199632093451731,4612199632093451729,4612199632092394534,4612199632092187460,4612199632093454084,4612199632093454574,4612199632093454569,461219963