R["fx__eu__@tristorm__89"]="{['Version']=1759,['Effects']={[1]={['Pitch']=0,['Contrast']=0.400000,['SizeY']=400,['MetaData']={['houseid']=78,['owner']='@Tristorm',},['Y']=22896,['EffectType']=4500,['X']=97705.424227,['Color']=990029,['Yaw']=2.242748,['SizeX']=140,['Id']=1001,['Alpha']=0.660000,['SizeZ']=400,['Z']=61704.783569,['Roll']=0,['Groups']=0,},[2]={['Pitch']=0,['Contrast']=1,['SizeY']=100,['MetaData']={['title']='Castle Septimus',},['Y']=22816,['EffectType']=595,['X']=97471.617876,['Color']=999999,['Yaw']=1.027999,['SizeX']=100,['Id']=1011,['Alpha']=1,['SizeZ']=100,['Z']=62264.424035,['Roll']=0,['Groups']=0,},[3]={['Pitch']=4.712564,['Contrast']=3.250000,['SizeY']=27,['MetaData']={['message']='Septimus Castle is a large keep & chantry located to the north of Leyawiin sitting on the Silverfish River. Built during the last decades of the Reman Empire during the 2nd era, the structure boasts the most grand and defensive architecture any bastion truly needs. The original construction has no relation to the House of Septimus, and would only be acquired by Lord Caladius VII after the dispersion from County Bruma.\\n\\nThe main entrance is accessed by boat, and can be entered through the passages underneath the chantry. The Chantry of Akatosh was blessed by Lord Caladius Septimus VII before the initial relocation to Septimus Castle; and now serves as a haven of devotion and peace for the nearing region.\\n\\nThe gardens of the Castle are larger than the prior at Fort Septimus, including a quaint river and classical Nibense Plaza, the hedges surrounding the entire gardens were unruly during the time of purchase, however have been tamed into beautiful examples of Imperial horticulture. The western side of the gardens includes the surrounding keep walls, interestingly these walls are not part of the purchased land, instead they are on a lease basis to the rest of the Castle at the grace of the Court of Leyawiin. It also includes various water run-off points, whether this be by grate or waterfall. The eastern gardens are much more active, with a river bountiful with surrounding foliage. Stables for the space of two horses, an execution area- transported from Old Fort Septimus, and importantly... The Crypt of House Septimus. Currently empty as the old crypt was left- this one remains as a reminder, a symbol of those who have fallen before... ',['title']='Castle Septimus - A History & Dissection',},['Y']=22825,['EffectType']=8503,['X']=95878.081690,['Color']=1119,['Yaw']=4.577999,['SizeX']=22.456456,['Id']=1016,['Alpha']=0,['SizeZ']=27,['Z']=61219.790363,['Roll']=0,['Groups']=0,},},['TS']=1629825801,}"
