R["gb__na__@malderyn__80"]="Serraphyn Delacroix (@Krynn_Kai-848418),1633854457;Lucien Sablehawk (@Spell-Slinger),1632927782;Icaric Sanguerre (@Dracenfer),1632861194;Nyhm (@Nyhm513),1631212472;Dara Shadowmane (@dara_shadowmane),1629946216;Arantiir (@Arantirr),1629811800;Harlequinn Shade (@tru418),1628218299;Hanalí Celaníl (@Seminolegirl1992),1628128417;Daragorn Galanodël (@Selphwraith2),1628130926;Liska Secunda (@Kitsusan),1627831930;Kyri-ma (@ThornFeather),1627828687;Alasdeir (@SixAlaric),1627827445;Frithawyn (@Kessira26),1627767925;Citrine Stone (@AzeliaStone),1627748871;Stabbitee (@StabbityDoom),1627747472;"
R["fx__na__@malderyn__80"]="{['TS']=1627795409,['Version']=1755,['Effects']={[1]={['Alpha']=1,['Y']=19611,['X']=107944.189055,['SizeZ']=70,['Color']=102439,['SizeY']=70,['MetaData']={['message']='16th of Sun\\'s Dawn, 2E 464\\nIt is a month since the day Father cast us out of Stormhaven for the crime of \\'unnatural relations\\'. Till now I am unsure which irked him more - the fact that Earandil was a boy, or that he was an Altmer? Mother tried to help us, but there was no way that Father would accept the disgrace to our house. As I write this, we are on a caravan bound for Dragonstar where a friend of Earandil owns an establishment.\\n\\n3rd of Second Seed, 2E 464\\nDisaster strikes again. Barely a week into our stay, a band of outlaws attacked the tavern, making off with everything they could grab and setting fire to the building. We barely escaped with our lives. Already deep in debt, Darien had no choice but to sell the land and move back to his village. On the road again.\\n\\n10th of Midyear, 2E 465\\nEarandil\\'s at it again. I know we\\'ve been travelling for over a year now and it hasn\\'t been easy, but it\\'s not like being disinherited and exiled was a choice. I thought he\\'d understand. Maybe the journey is just wearing on us. We\\'ve got to find somewhere to settle down and build a life of our own.\\n\\n21st of Hearthfire, 2E 466\\nWe\\'d been driven into a cave by a sudden snowstorm, losing our pack donkey with all our food and supplies outside. I think we might have just given up right there, if not for the old woman who suddenly appeared by the cave entrance. She laid her hands on our shoulders, with a sad expression on her face and a strange gleam in her eyes. \"Your journey is over. You can rest now.\" I remember her saying. With that, she pointed towards a doorway half-hidden behind a cleft in the rocks.\\n\\nEarandil was the first to step forward and I followed right after, opening the door into a magnificent dwarven ruin. When we glanced back, the lady was gone.',['title']='Diary of Saint Jacquen',},['Contrast']=1,['Z']=104827.782904,['Id']=1347,['SizeX']=46.456456,['Groups']=0,['Pitch']=4.886922,['Roll']=0,['Yaw']=0.628319,['EffectType']=8503,},[2]={['Alpha']=1,['Y']=27305,['X']=119519.257742,['SizeZ']=70,['Color']=102439,['SizeY']=70,['MetaData']={['message']='\\n\\n\\n\\n\\n\\n\\nWe, the Order of the Chromatic Sanctuary, pledge eternal allegiance to the Saints Jacquen and Earandil, and to our lady Meridia for her unfailing grace.\\n\\nOur lives and loves are our own.',['title']='Sanctum Creed',},['Contrast']=1,['Z']=101676.191611,['Id']=1348,['SizeX']=46.456456,['Groups']=0,['Pitch']=4.974188,['Roll']=0,['Yaw']=4.045673,['EffectType']=8501,},},}"
