R["fx__na__@malderyn__81"]="{['Version']=1731,['Effects']={[1]={['Yaw']=3.813544,['Y']=28286,['Alpha']=1,['Groups']=0,['SizeY']=50,['MetaData']={['message']='Malderyn, 2E 582\\n\\nThe following is a brief account of the forgotten sanctuary known as the Dragonheart Priory, as I have come to understand it.\\n\\nIn the year 1E 2815, just as Alduin\\'s Wall was under construction by the Dragonguard, a band of Imperial adventurers encountered an injured dragon high up in the mountains of Skyrim. Though the dragon was wounded to the point of death, the adventurers were awestruck by its majestic presence, swearing an oath to honor the dragon\\'s last words: \"Remember me.\"\\n\\nCarving out the heart of the dragon, they built a small shrine in the Hjaalmarch mountains, not far from where the dragon lay. In the years that followed, what began as a small group of caretakers soon evolved into a religious community dedicated to reviving the worship of the Dragon Cult.\\n\\nThe current building was started in 1E 2876 by the third High Priest, and finished in 1E 2892 in the waning years of the First Era. By all accounts the cult kept their activities to their mountain sanctuary, living a monastic life and passing on their traditions to new followers.\\n\\nSometime around 2E 460 it was found that the last of the Dragonheart cultists had died, leaving the priory abandoned and forgotten. The mountain retreat changed hands several times but was never inhabited for long.\\n\\nIn the year 582, after having saved the world, multiple times, I chanced upon the abandoned priory during my travels in Western Skyrim. Being a reformed daedric cultist myself, I could not resist the allure of its sacred architecture and promptly purchased the property from the Princess Svana, who was only too happy to grant the request for my aid in defeating the Gray Host.\\n\\nI have written this down in the hopes that you might be able to appreciate the history of this beautiful priory, as I have.',['title']='A Brief History of the Dragonheart Priory',},['EffectType']=8502,['X']=158810,['SizeX']=26.456456,['Roll']=0,['Contrast']=1,['Z']=160241,['Color']=102439,['SizeZ']=50,['Id']=1070,['Pitch']=4.712564,},[2]={['Yaw']=3.014184,['Y']=28018,['Alpha']=1,['Groups']=0,['SizeY']=130,['MetaData']={['message']='[This stone tablet bears an ornate carving of a dragon skull with intricate gold runes. The runes are incomprehensible to you, but someone has left a hastily scribbled note on the altar.]\\n\\n\"Dragon Cult tablet dating back to the First Era. Gold inscriptions came later - tablet repurposed into a memorial stone for Saint Hagen the Protector, the Dragonheart cult\\'s founding saint and patron. The stone is warm to the touch - to check for latent magical energy?\"',['title']='Gilt-Dragon Tablet',},['EffectType']=8501,['X']=160983,['SizeX']=86.456456,['Roll']=0,['Contrast']=1,['Z']=164159,['Color']=102439,['SizeZ']=130,['Id']=1071,['Pitch']=6.021386,},},['TS']=1622650349,}"
